import { LineChart, Line, CartesianGrid, ResponsiveContainer, XAxis, YAxis } from 'recharts';

export default function GraphDisplay({RTot, TTot, wavelengths}){
    let data = {"RTot": RTot, "TTot": TTot, "wavelengths": wavelengths}
    console.log(data)
    return(
        <div className="graphDisplay">
        Graph Display
        <ResponsiveContainer width="100%" height="90%">
            <LineChart style={{color: 'black'}} data={data}>
                <XAxis dataKey="wavelengths"/>
                <YAxis />
                <Line dataKey="RTot"/>
                <Line dataKey="TTot"/>
                <CartesianGrid strokeDasharray="3 3" />
            </LineChart>
        </ResponsiveContainer>
        </div>
    )
}
